:local(.subcontainer_community) {
    /*margin-bottom: 0;*/
    /*min-height: 100%;*/
    /*height: 100vh;*/
    /*width: 100%;*/
    /*background: #fff;*/


    height: 100%;
    min-height: 100%;
    padding-top: 10px;
    margin: 0 90px 0 310px;
    position: relative;
}


:local(.container_app_table) {
    display: table;
    width: 100%;
}

:local(.live_container) {
    display: table-cell;
    vertical-align: top;
    width: 1350px;
}

:local(.page_title) {
    font-size: 32px;
    color: #404a5e;
    font-weight: 300;
    line-height: 1.4;
    margin-top: 0;
    margin-bottom: 3px;
}


:local(.people_tab) {
    width: 100%;
    border-bottom: 2px solid #dadbde;
    position: relative;

    margin-bottom: 20px;
}

:local(.people_tab ul) {
    display: inline-block;
    margin: 0 0 -2px;
    padding: 0;
    vertical-align: middle;
}


:local(.people_tab ul li) {
    float: left;
}

:local(.people_tab .active) {
    border-bottom: 4px solid #00c2af;
    color: #00c2af;
}

:local(.people_tab a:hover) {
    border-bottom: 4px solid #00c2af;
    color: #00c2af;
}

:local(.people_tab a) {
    display: inline-block;
    padding: 10px 37px 8px;
    font-size: large;
    color: #BCBCBC;

    background: 0 0;
    color: inherit;
    text-decoration: none;
}
